class Solution:
    # @param board, a list of lists of 1 length string
    # @param word, a string
    # @return a boolean

    def _check(self, board, word, start_i, start_j, mem):
        # print(start_i, start_j, word, mem)

        word_n = len(word)
        n_i = self.n_i
        n_j = self.n_j

        if word_n == 1 and board[start_i][start_j] == word[0]:
            return True

        if start_i < 0 or start_j < 0:
            return False

        if start_i > n_i - 1 or start_j > n_j - 1:
            return False

        if board[start_i][start_j] != word[0]:
            return False

        if (start_i +  1 < n_i) and not mem[ start_i + 1][start_j]:
            mem[start_i + 1][start_j] = True
            if self._check(board, word[1:], start_i + 1,start_j, mem) : return True
            mem[start_i + 1][start_j] = False

        if (start_j +  1 < n_j) and not mem[start_i][start_j + 1]:
            mem[start_i][start_j + 1] = True
            if self._check(board, word[1:], start_i,start_j + 1, mem) : return True
            mem[start_i ][start_j + 1] = False

        if (start_i -  1 >= 0 ) and not mem[start_i - 1][start_j ]:
            mem[start_i - 1][start_j ] = True
            if self._check(board, word[1:], start_i - 1 ,start_j, mem): return True
            mem[start_i - 1][start_j ] = False

        if (start_j -  1 >= 0 ) and not mem[start_i][start_j - 1]:
            mem[start_i][start_j - 1] = True
            if self._check(board, word[1:], start_i ,start_j - 1, mem) : return True
            mem[start_i][start_j - 1] = False

        # if board[start_i][start_j] == word[0] and word_n == 1: return True

        return False

    def exist(self, board, word):
        if len(word) == 0: return True
        if len(board) == 0: return False

        self.n_i = len(board)
        self.n_j = len(board[0])
        # print(self.n_i, self.n_j)


        for index_i in range(self.n_i):
            for index_j in range(self.n_j):
                if board[index_i][index_j] == word[0]:
                    mem = [ [ False ] *  self.n_j for i in range(self.n_i)  ]
                    mem[index_i][index_j] = True
                    if self._check(board, word, index_i, index_j, mem):
                        return True
        return False


